ControlPropertyState.AutoRuleBindingString:
    
    //Reset the all recent changes go back to existing assignment page
        Reset(ComboBox1_3);
        Reset(ComboBox2_3);
        Reset(ComboBox3_3);
        Reset(ComboBox4_3);
        Reset(ComboBox5_3);
        Reset(DatePicker2_3);
        Reset(DatePicker1_6);
        Reset(DatePicker1_7);

      Navigate(projectAssignment,ScreenTransition.None);

If(
    Connection.Connected = false,
    Notify("Network is not Available"),

    If(
        IsBlank(ComboBox2_3.Selected.Go_Number),
        Notify(
            "Please Select Bank.",
            NotificationType.Error
        )
    );
    If(
        IsBlank(ComboBox3_3.Selected.type),
        Notify(
            "Please Select Assessment Type.",
            NotificationType.Error
        )
    );
    If(
        IsBlank(ComboBox4_3.Selected.displayName),
        Notify(
            "Please Select Assessor.",
            NotificationType.Error
        )
    );
    If(
        IsBlank(ComboBox5_3.Selected.displayName),
        Notify(
            "Please Select Reviewer.",
            NotificationType.Error
        )
    );
    If(
        IsBlank(DatePicker1_6.SelectedDate),
        Notify("Please Select Due Date")
    );
    If(
        DateDiff(
            DatePicker2_3,
            DatePicker1_6
        ) <= 0,
        Notify("Please select correct Due Date ")
    );
    If(
        !IsBlank(ComboBox2_3.Selected.Go_Number) &&
        !IsBlank(ComboBox3_3.Selected.type) && 
        !IsBlank(ComboBox4_3.Selected.displayName) && 
        !IsBlank(ComboBox5_3.Selected.displayName) &&
        DateDiff(
            DatePicker2_3,
            DatePicker1_6
        ) >= 1,
        Set(
            patchresult,
            Patch(
                projectAssignment_1,
                LookUp(
                    projectAssignment_1,
                    'projectAssignment (quantum_projectassignment)' = nprojectassignment
                ),
                {
                    // 'projectAssignment (quantum_projectassignment)': "upass11",
                   // clientId: LookUp(
                   //     Client,
                    //    client_name = ComboBox1_2.Selected.client_name
                   // ),
                    bankId: LookUp(
                        bank,
                        Go_Number = ComboBox2_3.Selected.Go_Number
                         // ThisRecord.Go_Number
                    ),
                    assessment_type_1: ComboBox3_3.Selected.type,
                    assessor_id: LookUp(
                        AssessorAD,
                        displayName = ComboBox4_3.Selected.displayName,
                        id
                    ),
                    reviewer_id: LookUp(
                        ReviewerAD,
                        displayName = ComboBox5_3.Selected.displayName,
                        id
                    ),
                    start_date: DatePicker2_3.SelectedDate,
                    due_date: DatePicker1_6.SelectedDate,
                    'Assigned_date ': DatePicker1_7.SelectedDate,
                    IsComplete: "Upcomming",
                    assessor_email: LookUp(
                        AssessorAD,
                        displayName = ComboBox4_3.Selected.displayName,
                        mail
                    ),
                    Reviewer_email: LookUp(
                        ReviewerAD,
                        displayName = ComboBox5_3.Selected.displayName,
                        mail
                    ),
                    assessor_name: LookUp(
                        AssessorAD,
                        displayName = ComboBox4_3.Selected.displayName,
                        displayName
                    ),
                    reviewer_name: ComboBox5_3.Selected.displayName
                     
                }
            )
        );
  
  If(!IsBlank(patchresult),Notify("Success");
       Set(updatePopup,true);
        Reset(ComboBox1_3);
        Reset(ComboBox2_3);
        Reset(ComboBox3_3);
        Reset(ComboBox4_3);
        Reset(ComboBox5_3);
        Reset(DatePicker2_3);
        Reset(DatePicker1_6);
        Reset(DatePicker1_7);
       
  ,Notify("Errorr patch"));

       
      
);
)

